def seq_from_name(query):
    '''
    Function to get the uniprot_id of a protein from the name. 

    Parameters
    ----------
    query: string
        A string that carries the details fo the protein to search for. Can 
        contain the name of the protein as well as the name of the organims.
            ex. ARF19
                Arabidopsis ARF19
                p53
                Human p53
                Homo sapiens p53

    Returns
    -------
    top_hit : string
        Returns the amino acid sequence of the top hit on uniprot
        website.
    '''

    # first format name into a url
    # uses only reviewed on first attempt.
    split_name = query.split(' ')
    if len(split_name) == 1:
        use_url=f'https://rest.uniprot.org/uniprotkb/search?size=15&format=fasta&query={split_name[0]}%20AND%20%28reviewed%3Atrue%29'
        top_five = requests.get(use_url).text
        query_keywords=split_name[0]
        
    else:
        # format the search string.
        split_name = parse_input(query)
        # if you don't have a taxid, you're hitting the 'feeling lucky' button on early 2000s Google more or less TBH.
        add_vals = split_name['gene_info']
        query_keywords = split_name['gene_info']
        add_str = ''
        for i in add_vals:
            add_str += i
            add_str += '%20'
        add_str = add_str[0:len(add_str)-3]
        # if no taxid...
        if split_name['taxid']=='':
            # one below filters for the reviewed proteins.
            use_url = f'https://rest.uniprot.org/uniprotkb/search?format=fasta&size=15&query={add_str}%20AND%20%28reviewed%3Atrue%29'
            # pull top 5 fastas
            top_five = requests.get(use_url).text
            if top_five == '':
                # do unreviewed.
                use_url = f'https://rest.uniprot.org/uniprotkb/search?format=fasta&size=15&query={add_str}%20AND%20%28reviewed%3Afalse%29'
                top_five = requests.get(use_url).text
        else:
            # one below filters for the reviewed proteins.
            # trying change to organism_id, no idea if it will work.
            use_url = f"https://rest.uniprot.org/uniprotkb/search?format=fasta&size=15&query={add_str}%20AND%20%28reviewed%3Atrue%29%20AND%20%28organism_id%3A{split_name['taxid']}%29"
            top_five = requests.get(use_url).text
            if top_five == '':
                # do unreviewed.
                use_url = f"https://rest.uniprot.org/uniprotkb/search?format=fasta&size=15&query={add_str}%20AND%20%28reviewed%3Afalse%29%20AND%20%28organism_id%3A{split_name['taxid']}%29"
                top_five = requests.get(use_url).text    

    # if using org id before, take out and try agian.
    if type(split_name)==dict:
        if split_name['taxid']!='':
            if top_five == '':
                use_url = f'https://rest.uniprot.org/uniprotkb/search?format=fasta&size=15&query={add_str}%20AND%20%28reviewed%3Afalse%29'
                top_five = requests.get(use_url).text

    if top_five == '':
        raise Exception('Unable to find sequence.')


    # header placeholder
    header = ''
    final_vals = []
    # now try to get right fasta
    fastas_split = top_five.split('>')[1:]
    
    most_matches = 0
    best_seq=''

    for header_seq in fastas_split:
        temp_seq = ''
        split_by_lines = header_seq.split('\n')
        header = split_by_lines[0].lower()
        temp_header = ''
        for i in header:
            if i == '_':
                temp_header += ' '
            else:
                temp_header += i
        header=temp_header

        if type(query_keywords) == str:

            if query_keywords in header:
                for chars in split_by_lines[1:]:
                    temp_seq+=chars
                final_vals = [header, temp_seq]
                return final_vals
        
        else:
            gene_name = header.split('gn=')[1].split(' ')[0]
            organism_name = header.split('ox=')[1].split(' ')[0]
            cur_matches=0
            for i in query_keywords:
                if i in header:
                    cur_matches += 1
                    if i == gene_name:
                        cur_matches += 2
                    if parse_input(query)['taxid'] != '':
                        if i == parse_input(query)['taxid']:
                            cur_matches += 1
            if cur_matches > most_matches:
                temp_seq=''
                most_matches = cur_matches
                for chars in split_by_lines[1:]:
                    temp_seq+=chars
                best_seq = temp_seq
                final_vals = [header, best_seq]
    

    if final_vals != []:
        return final_vals

    else:
        seq_to_use = fastas_split[0]
        split_by_lines = seq_to_use.split('\n')
        header = split_by_lines[0].lower()
        for chars in split_by_lines[1:]:
            temp_seq+=chars
        final_vals = [header, temp_seq]
        return final_vals

    # if we have still failed... well darn.
    raise Exception('Unable to find sequence.')

def seq_from_uniprot_id(query):
    '''
    function to specifically pull a sequence
    using a uniprot ID. This will ONLY WORK
    if you have the correct ID. However,
    this has the advantage of letting the user
    pull different isoforms. 

    parameters
    ----------
    query : str
        the uniprot ID as a string

    returns : list
        list where first element is the seq header
        and the second is the sequence. 
    '''
    # set url and make sure no spaces make it through. 
    use_url = f'https://rest.uniprot.org/uniprotkb/{query}.fasta'
    # get text using requests
    entry = requests.get(use_url).text
    # split by new line
    entry = entry.split('\n')
    # set header
    header=entry[0]
    # combine rest of lines into sequence
    seq=''.join(entry[1:])
    return [header,seq]


